import React from "react";
import VideoHomePage from "../assets/chanh.mp4";
const HomePage = (props) => {
  return (
    <div className="homepage-container">
      <video
        autoPlay=""
        loop=""
        width="750"
        height="500"
        translate="90deg"
        controls
      >
        <source src={VideoHomePage} type="video/mp4" />
      </video>
    </div>
  );
};

export default HomePage;
